Memory Map (Ordnance Survey) For walkers and cyclists for planning routes and navigating from your GPS phone

All the UK 1:50 Maps

I have had this running on Windows XP, 7 x86, 7 x64, Windows Mobile 5 &amp; 6

For Android Phones use MM Tracker (it uses the &quot;Memory Map&quot; maps
